import { Container, NavbarBrand, Nav } from "react-bootstrap";

const NavigationBar = () => {
  return (
    <div>
      <Container className="color-white d-flex justify-content-center align-items-center">
        <Nav>
          <NavbarBrand>AksaraKU</NavbarBrand>
        </Nav>
      </Container>
    </div>
  );
};

export default NavigationBar;
